                            Rezija = "Lajla Kaikčija",
                            Sadrzaj = "“Reality televizija je žanr televizijskog programa koji dokumentira navodno neskriptirane situacije iz stvarnog života nepoznatih pojedinaca, a ne profesionalnih glumaca. Mreže i producenti pokušavaju uvjeriti gledaoce da uistinu gledaju realne scene, no očito je da nas jednostavno “bombardiraju” filmovima bez scenarija. Gledaoci reality showa svjedoče previranjima, mržnji i nezadovoljstvu koje te emisije redovno promoviraju, stvaraju vezu s plastičnim likovima sa TV-a i razvijaju ljubav prema “luksuznom” načinu života reality zvijezda. Ukupni utjecaj tih emisija na društvo ogleda se u broju onih koji ih prate. Što više ljudi smatra ideje takvih emisija normalnim, veći je i ukupni utjecaj. Reality televizija utječe na publiku manipulirajući njenim moralom koristeći zabavnu stvarnost koja generira neetične vrijednosti poput materijalizma, niskog samopoštovanja... Veliča zlostavljanje, uzdiže plitke osobnosti i promovira disfunkcionalne odnose. Pogođenost društva tim emisijama ogleda se najjasnije u činjenici da gledaoci reality televizije zauzimaju stavove iz emisija i prenose ih drugima oko sebe u svakodnevnom životu. Televizija je moćan alat koji se koristi za komunikaciju s velikim brojem ljudi, a bezumna zabava i snovi o euforičnom načinu života postali su odraz vrijednosti društva.”, zapisao je o predstavi rediteljica Emir Spahić",
