                            Sadrzaj = "“„Alfa Beta“ se bavi bračnim odnosima, odnosima u porodici uopćeno propitujući instituciju braka sa pozicije izbora ulaska ili ne u ovu zajednicu, kakve reperkusije na naš život on ostavlja i šta sa sobom kroz vrijeme brak nosi. Zanimljiva, dinamična i univerzalna priča o ljudskoj otuđenosti, otuđenosti od sebe i od drugih. Priča o dubokim intimnih strahovima oslikanim u likovima bračnih partnera koji proživljavaju vlastite krize izbora i odluka koje oblikuju njihove živote. Propitujući smisao braka, likovi dovode pod znak pitanja i uvriježene vrijednosti koje su uz brak vezane, i postavljaju pitanje da li su naša očekivanja prevarena? Da li u svim bračnim i životnim fazama osjećamo onu platonsku ljubav i zanos kao na početku veze ili to može prerasti u nešto drugo i šta je to? Ključno pitanje je, koliko ostajemo svoji kroz vrijeme, koliko smo dužni ostati vjerni sebi a koliko instituciji braka, i kako nas to oblikuje.”, zapisao je o predstavi Saša Oručević",
